class AddProduct extends Component {
  constructor(props) {
    super(props);
    this.state = {
      projectName:'',
      cancerType:'',
      biosampleTumorfile1:'',
      biosampleTumorfile2:'',
      biosampleTumorfile3:'',
      biosampleTumorfile4:'',


      errors: []
    };
  }
  handleForm = e => {
    e.preventDefault();
    const data = new FormData()
    const { projectName, cancerType, biosampleTumorfile1,biosampleTumorfile2,biosampleTumorfile3,biosampleTumorfile4 } = this.state;
    const errors = validate(projectName, cancerType, biosampleTumorfile1,biosampleTumorfile2,biosampleTumorfile3,biosampleTumorfile4);
    if (errors.length > 0) {
    this.setState({ errors });
      return

    }

    data.append('projectName', this.state.projectName)
    data.append('cancerType', this.state.cancerType)
    data.append('biosampleTumorfile1', this.state.biosampleTumorfile1)
    data.append('biosampleTumorfile2', this.state.biosampleTumorfile2)
    data.append('biosampleTumorfile3', this.state.biosampleTumorfile3)
    data.append('biosampleTumorfile4', this.state.biosampleTumorfile4)


    // axios
    APIService.createDATA(data).then(result => {
      console.log(result);
      NotificationManager.success("Project Added Sussceefully");
    })
    .catch(err => {
      if (err.response && err.response.status === 400)
        NotificationManager.error(err.response.data.msg);
      else
        NotificationManager.error("Something Went Wrong");
      this.setState({ errors: err.response })
    });
};
